import React from "react";
import Autocomplete from "@mui/material/Autocomplete";

export default function SignUp() {
  return (
    <div>
      <Autocomplete
        disablePortal
        id="combo-box-demo"
        sx={{ width: 300 }}
      />
    </div>
  );
}
